VALUES ('3564700511428', 'Plaisir & Gourmandise Surimi Crudités', 'Garniture 51% : préparation à base de _surimi_ décongelé 26,7% (_surimi_ 10% (chair de _poisson_ 9%; stabilisants : sorbitols (dont _blé_), E450, E451, E452; sucre); eau; amidon de _blé_; blanc d\'_œuf_ réhydraté; huile de colza; sel; arômes (dont _crustacés_ et _poissons_); exhausteur de goût: glutamate monosodique (dont _blé_); colorant: extrait de paprika); crudités 12,7% (salade, tomate); mayonnaise allégée en matières grasses 11,3% (eau; huile de colza 30%; vinaigre d\'alcool; jaune d\'_œuf_; amidon modifié; sucre; _moutarde_ de Dijon (eau, graines de _moutarde_, vinaigre d\'alcool, sel, antioxydant: disulfite de potassium, acidifiant : acide citrique); sel; épaississant: gomme xanthane; acidifiant: acide citrique; conservateur: E202; colorants: lutéine, extrait de paprika). Pain de mie complet 49% : farine complète de _blé_, eau, huile de colza, levure, sucre, sel, _gluten_ de _blé_, dextrose, conservateur: E282, farine de _blé_, émulsifiant: E471, agent de traitement de la farine: acide ascorbique.', 'https://static.openfoodfacts.org/images/products/356/470/051/1428/front_fr.6.400.jpg', '6.2', '0.5', '26.4', '3.4', '2.8', '6.2', '1.3', '0.511811023622047', '', '0');

