VALUES ('3564700515846', 'Mini-Feuilletés ', '10 feuilletés au saumon (25%) : pâte feuilletée dorée 70%* : farine de_blé_, margarine (huiles et graisses végétales (palme, colza), eau, sel, E471. correcteur d‘acidité : acide citrique, eau, sel, lactose et protéines de _lait_, crème en poudre, œuf en poudre. Garniture 29,5%  eau, pulpe de _saumon_ fumé 8.5%* (_saumon_ atlantique - Salmo salar, sel) amidon modiﬁé de pomme de terre, _lactosérum_ en poudre, double concentré de tomates, fumet de poisson aromatisé (sel, _lactose_, arômes (contient des _crustacés_, _mollusques_), sucre, amidon de pomme de terre, maltodextrine, poisson en poudre, épaississant : gomme d’acacia), _œuf_ en poudre, ail, sel, poivre. Saupoudrage 0,5%* : aneth déshydraté. 10 mini-feuilletés saveur pizza (25%) :  Pâte feuilletée dorée 60%* : farine de _blé_, margarine (huiles et graisses végétales (palme, colza), eau, sel, émulsiﬁant : E471, correcteur d\'acidité : acide citrique), eau, sel, _lactose_ et protéines de _lait_, _crème_ en poudre, _œuf_ en poudre. Garniture 39,5%* : eau, purée de tomates mi-réduite 13%*, amidon modifié de pomme de terre, lactosérum en poudre, double concentré de tomates 1,3%*, assaisonnement 0,8%*\' (tomate en poudre, set, maltodextrine, plantes aromatiques, dextrose, extraits de plantes aromatiques), emmental râpé 0,6%ﬁ (dont fécule de pomme de terre), œuf en poudre, arôme naturel (contient du lait), poivre, basilic. Saupoudrage 0,5% : origan. 10 mini-feuilletés jambon-fromage (25%) : Pâte feuilletée dorée 70%* : farine de _blé_, margarine (huiles et graisses végétales (palme, colza), eau, sel, émulsiﬁant : E471, correcteur d\'acidité : acide citrique), eau, sel, _lactose_ et protéines de _lait_, _crème_ en poudre, _œuf_ en poudre. Garniture 29% : eau, amidon modifié de pomme de terre, lactosérum en poudre, jambon cuit 2,9% (jambon de porc ; eau ; sel ; arômes ; sirop de glucose ;conservateurs : E250, E316 ; stabilisants: E450, E451), arômes (dont arômes de fumée), fromage fondu 0,5%* (fromages ; eau ; sels émulsifiants :. E339, E452 ; sel), _œuf_ en poudre, arôme naturel (contient du _lait_). Saupoudrage 1%* : graines de pavot. 10 mini-feuilletés au fromage (25%): pâte feuilletée dorée 70%* : farine de _blé_, margarine (huiles et graisses végétales (palme, colza), eau, sel, E471, correcteur d’acidité : acide citrique, eau, sel, _lactose_ et protéines de _lait_, _crème_ en poudre, _œuf_ en poudre. Garniture 25,5% eau, _emmental_ râpé 4,8%* (dont fécule de pomme de terre), amidon modiﬁé  de pomme de terre, _lactosérum_ en poudre, _Roquefort_ fondu 0,5%* (_Roquefort_, eau, sels émulsifiants : E339.  E452), sel, _œuf_ en poudre, _lactose_, _crème_ en poudre, _lait_ écrémé en poudre, farine de _blé_, épices. Saupoudrage 4,5% : _emmental_ râpé (dont fécule de pomme de terre).', 'https://static.openfoodfacts.org/images/products/356/470/051/5846/front_fr.8.400.jpg', '19.2', '9.8', '29.3', '4.9', '1', '5.5', '1.32', '0.519685039370079', '', '0');

