INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3564700532461', 'Cones sorbet Trofic Mangue passion', 'Sorbet à la mangue 35,5% : eau ; purée de mangue 12,4%; sirop de glucose-fructose ; sucre ; dextrose ; jus de citron à base de concentré ; stabilisants : gomme guar, E466, farine de graines de caroube, pectines; extrait de curcuma ; arôme naturel; protéines de pois hydrolysées; colorant : caroténoides. Sorbet aux fruits de la passion 35,5% : jus de fruits de la passion à base de concentré 12,3% ; eau ; sirop de glucose-fructose ; sucre ; stabilisants : gomme guar, farine de graines de caroube, pectines ; lactose et protéines de lait; arôme naturel de fruits de la passion ; extrait de curcuma ; dextrose ; protéines de pois hydrolysées ; jus de betterave concentré. Cornet biscuit 14,5% : farine de blé, sucre, graisse de coprah, émulsifiant : lécithines (soja). Chemisage (intérieur cône) et bonbon au cacao maigre 7,9% : graisses végétales (palmiste, palme), sucre, cacao maigre en poudre 0,79%, émulsifiant: lécithines (soja). Sauce à la mangue et aux fruits de la passion 5,3% : mangue 2,6%, sucre, fruits de la passion 0,53%, amidon de mais, correcteur d\'acidité : E331, arôme naturel. Décor de noix de coco râpée 1,3% : noix de coco, conservateur : anhydride sulfureux. Traces de fruits à coque. Les pourcentages sont exprimés sur le produit total.', 'https://static.openfoodfacts.org/images/products/356/470/053/2461/front_fr.8.400.jpg', '5.8', '4.1', '40', '30', '1.1', '1.7', '0.03', '0.0118110236220472', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3564700532508', 'Cône Sorbet Fruits Rouges (framboise, Fraise Et Cassis)', 'Sorbet aux fruits rouges 37% : eau, sucre, purée de fraise 15%, purée de cassis 9%, purée de framboise 5%, sirop de glucose, sirop de glucose-fructose, épaississant : gomme xanthane, gélifiant : gomme guar, jus de citron concentré, arômes naturels, dextrose, protéines de pois hydrolysées (pois, sucre). (% exprimés sur le sorbet au fruits rouges). Sorbet à la fraise 18,5% : eau, purée de fraise 25%, sucre, sirop de glucose-fructose, sirop de glucose, épaississant : gomme xanthane, gélifiant : gomme guar, acidifiant : acide citrique, arôme naturel, dextrose, colorant : rouge de betterave, protéines de pois hydrolysées (pois, sucre). (% exprimés sur le sorbet à la fraise). Sorbet au cassis 17,8% : eau, purée de cassis 25%, sucre, sirop de glucose-fructose, sirop de glucose, protéines de pois hydrolysées (pois, sucre), colorant : anthocyanes, arôme naturel, jus de citron concentré, gélifiants : pectines, gomme xanthane, gomme tara, dextrose. (% exprimé sur le sorbet cassis). Cornet biscuit 14,5% : farine de _blé_, sucre, graisse végétale de coprah, émulsifiant : lécithines (_soja_), sel. Chemisage (intérieur cône) au cacao maigre 6,9% : graisse végétale de coprah, sucre, cacao maigre en poudre, émulsifiant : lécithines (_soja_). (% exprimé sur le chemisage). Sauce aux fruits rouges 3,8% : purée de fruits rouges 45% (fraise, myrtille, framboise, cassis), sucre, sirop de glucose-fructose, eau, sirop de sucre inverti, amidon modifié de maïs, gélifiants : gomme xanthane, farine de graines de caroube, acidifiant : acide citrique, colorant : anthocyanes, correcteur d\'acidité : E331, extrait de curcuma et d\'hibiscus. (% exprimé sur la sauce). pépites de cassis (inclusions) 1,5% : jus de cassis 34%, sucre, pomme, dextrose, fibres d\'ananas, arôme naturel, gélifiant : alginate de sodium, stabilisant : E341, correcteur d\'acidité : E332, jus concentré de sureau. (% exprimé sur les pépites).', 'https://static.openfoodfacts.org/images/products/356/470/053/2508/front_fr.8.400.jpg', '4.5', '3.9', '35.9', '26.9', '1.5', '1.4', '0.1', '0.0393700787401575', '', '0');

