VALUES ('3564700532669', 'Glace Trium Café x4', 'Glace au café 55,5% : _lait_ écrémé, sirop de glucose-fructose, eau, sucre, graisse végétale de coprah, _lactose_ et protéines de _lait_, arôme naturel de café (dont colorant : caramel ordinaire), extrait de café en poudre 0,7%, émulsiﬁant : E471, morceaux de café 0,1%, stabilisant : alginate de sodium. Enrobage au chocolat noir 30,1% : sucre, pâte de cacao 9,7%, beurre de cacao 6,7%, _beurre_ concentré, émulsiﬁant : lécithines (_soja_), arôme naturel de vanille.  Sauce au café 11% : sirop de glucose, café concentré 3,4%, sucre inverti, amidon modifié de maïs, extrait de café 0,3%, sucre, sel, conservateur : E202.  Éclats de fèves de cacao 3,4%. (Les pourcentages sont exprimés sur le produit total)', 'https://static.openfoodfacts.org/images/products/356/470/053/2669/front_fr.13.400.jpg', '20.5', '14.1', '35.3', '32.2', '2.4', '3.4', '0.125', '0.0492125984251968', '', '0');

